import React from "react";

const ProductPopup = () => {
  return (
    <div>
      <img
        src="/image/admin/popupProductUpload.png"
        alt="popup"
        style={{ width: "400px" }}
      ></img>
    </div>
  );
};

export default ProductPopup;
